import React, { Component } from 'react';
import "../styles/name.css"

class Name extends Component {
    render() {
        return (
            <div className="name">
                <div id="boxWrapper">
                    <div className="first">
                    <div className="box animated introAnimation">J</div>
                    <div className="box animated introAnimation two">A</div>
                    <div className="box animated introAnimation three">S</div>
                    <div className="box animated introAnimation four">O</div>
                    <div className="box animated introAnimation five">N</div>

                    <div className="box animated introAnimation six">B</div>
                    <div className="box animated introAnimation seven">R</div>
                    <div className="box animated introAnimation eight">O</div>
                    <div className="box animated introAnimation nine">O</div>
                    <div className="box animated introAnimation ten">K</div>
                    <div className="box animated introAnimation eleven">S</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Name;
